class Roca {
    id: string;
    nombre: string;
    grupo: string;
    dureza: number;
    tamañoDeGrano: string;
    clasificacion: string;
    tamañoDeCristales: number;
    temperaturaDeFormacion: number;
    estructura: string;
    formasDeGranos: string;
    textura: string;
}

function fahrenheitToCelsius(fahrenheit: number): number {
    return (fahrenheit - 32) * 5 / 9;
}

document.getElementById("imprimir")?.addEventListener('click', function (event) {

    let group = (document.getElementById("group") as HTMLSelectElement).value;
    let tamañoGrano = (document.getElementById("tamañoGrano") as HTMLSelectElement).value;
    if (group === "igneas" && tamañoGrano === "granoMuyGrueso") {
        document.write('<img src="data:image/jpeg;base64,">');
    } else {
        document.write('<img src="data:image/jpeg;base64,">');
    }
});

interface IValidatorIgneo {
    isValid(): string;
}



